// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract KeyValueStore {
    address public receiver;

    // Set the receiver address
    function setReceiver(address _receiver) public {
        receiver = _receiver;
    }

    // Function to send Ether to the receiver address
    function sendEther() public payable {
        require(msg.value > 0, "No Ether sent");
        payable(receiver).transfer(msg.value); // Send Ether to the receiver
    }

    // Check current receiver
    function getReceiver() public view returns (address) {
        return receiver;
    }
}
